import axios from "axios";

class RestHelper {
    GetSchedulerDat () {
        axios.get("localhost:7777/api/scheduler/test").then((response) =>{
            console.log("AHHHAHAHAH");
            console.log(response.data);
            return response.data;
        })
    }
}

export default RestHelper;
